import React from "react";
import DetroitCards from "./DetroitCards";
import "./DetroitList.css"

function DetroitList( { cards }) {
    return (
        <div className="DetroitList">
            {
                cards.map((card) =>
                <DetroitCards card={card} />
            )
            }
        </div>

    )
}

export default DetroitList;
